(1, 'Thắng Việt Cao', 'Thang Viet Cao is a solutions architect, consultant and software developer that has a particular interest in all things related to Big Data, Cloud & API. He\'s also a many-times best seller instructor on Udemy for his courses in Apache Kafka and AWS.', 'hanjo', 0),
(2, 'CTQM', 'CTQM has a BS and MS in Mechanical Engineering from Santa Clara University and years of experience as a professional instructor and trainer for Data Science and programming. He has publications and patents in various fields such as microfluidics, materials science, and data science technologies. Over the course of his career he has developed a skill set in analyzing data and he hopes to use his experience in teaching and data science to help other people learn the power of programming the ability to analyze data, as well as present the data in clear and beautiful visualizations. Currently he works as the Head of Data Science for Pierian Data Inc. and provides in-person data science and python programming training courses to employees working at top companies, including General Electric, Cigna, The New York Times, Credit Suisse, McKinsey and many more. Feel free to contact him on LinkedIn for more information on in-person training sessions or group training sessions in Las Vegas, NV.', 'CTQM', 0);

