INSERT INTO `library_contents` (`id`, `menu_id`, `header1`, `content1`, `header2`, `content2`, `header3`, `content3`, `header4`, `content4`) VALUES
(1, 9, 'HTML Tutorial', 'HTML stands for Hyper Text Markup Language, which is the most widely used language on Web to develop web pages. HTML was created by Berners-Lee in late 1991 but \"HTML 2.0\" was the first standard HTML specification which was published in 1995. HTML 4.01 was a major version of HTML and it was published in late 1999. Though HTML 4.01 version is widely used but currently we are having HTML-5 version which is an extension to HTML 4.01, and this version was published in 2012.', 'Why to Learn HTML?', 'Originally, HTML was developed with the intent of defining the structure of documents like headings, paragraphs, lists, and so forth to facilitate the sharing of scientific information between researchers. Now, HTML is being widely used to format web pages with the help of different tags available in HTML language.\r\n\r\nHTML is a MUST for students and working professionals to become a great Software Engineer specially when they are working in Web Development Domain. I will list down some of the key advantages of learning HTML:', 'Prerequisites', 'Before proceeding with this tutorial you should have a basic working knowledge with Windows or Linux operating system, additionally you must be familiar with − Experience with any text editor like notepad, notepad++, or Edit plus etc.\r\nHow to create directories and files on your computer.\r\nHow to navigate through different directories.\r\nHow to type content in a file and save them on a computer.\r\nUnderstanding about images in different formats like JPEG, PNG format.', NULL, NULL),
(2, 5, 'Computer Fundamentals Tutorial', 'Computer is an advanced electronic device that takes raw data as an input from the user and processes it under the control of a set of instructions (called program), produces a result (output), and saves it for future use. This tutorial explains the foundational concepts of computer hardware, software, operating systems, peripherals, etc. along with how to get the most value and impact from computer technology.\r\n\r\n', 'Audience', 'This tutorial has been prepared for beginners as well as advanced learners who want to deal with computers. The tutorial is also very useful for undergraduate students of computer science, engineering, business administration, management, science, commerce and arts, where an introductory course on computers is a part of curriculum.\r\n\r\nAfter completing this tutorial, you will find yourself at a moderate level of expertise in the knowledge of computer basics from where you can take yourself to the next level.', 'Prerequisites', 'Knowledge of computers is not a prerequisite to follow the contents of this tutorial. This tutorial assumes no background in Computers or Computer programming.', NULL, NULL),
(3, 1, 'Machine Learning Tutorial', 'Today’s Artificial Intelligence (AI) has far surpassed the hype of blockchain and quantum computing. The developers now take advantage of this in creating new Machine Learning models and to re-train the existing models for better performance and results. This tutorial will give an introduction to machine learning and its implementation in Artificial Intelligence.', 'Audience', 'This tutorial has been prepared for professionals aspiring to learn the complete picture of machine learning and artificial intelligence. This tutorial caters the learning needs of both the novice learners and experts, to help them understand the concepts and implementation of artificial intelligence.', 'Prerequisites', 'The learners of this tutorial are expected to know the basics of Python programming. Besides, they need to have a solid understanding of computer programing and fundamentals.\r\n\r\nIf you are new to this arena, we suggest you pick up tutorials based on these concepts first, before you embark on with Machine Learning.', NULL, NULL),
(4, 13, 'C Tutorial', 'C programming is a general-purpose, procedural, imperative computer programming language developed in 1972 by Dennis M. Ritchie at the Bell Telephone Laboratories to develop the UNIX operating system. C is the most widely used computer language. It keeps fluctuating at number one scale of popularity along with Java programming language, which is also equally popular and most widely used among modern software programmers.', 'Audience', 'This tutorial is designed for software programmers with a need to understand the C programming language starting from scratch. This C tutorial will give you enough understanding on C programming language from where you can take yourself to higher level of expertise.', 'Prerequisites', 'Before proceeding with this tutorial, you should have a basic understanding of Computer Programming terminologies. A basic understanding of any of the programming languages will help you in understanding the C programming concepts and move fast on the learning track.', NULL, NULL);

