INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(1, 'FullStack Web Development Prime Pack', 'Become a Full-Stack Web Developer', 1, 9, 60, 'Tutorialspoint’s Web Development Guide for 2022 has been specifically designed for Full-Stack Web Development. You will get a firm foundation for your front-end and back-end web development. We have designed the guide to get you started with HTMl, CSS and JavaScript for your front-end design. Similarly, you will also learn to set up your server using PHP, MYSQL, and NodeJS. Once you are comfortable with stepping stones, get a hands-on experience for building more engaging web applications using JavaScript Frameworks such as React, Angular, Vue or Laravel.', '43', 115, 'Willing to become a professional full-stack web developer', 'Everything you need is covered in the bundle', 'Installed with Windows/Linux/OS', 'Start your journey of becoming a successful web development from scratch.\r\nLearn about different concepts and usage of HTML, CSS, Bootstrap using different trending projects.\r\nGet hands-on experience of Full Stack Development With Angular And Spring Boot.\r\nIntegrating React with Express and MongoDB.\r\nBuilding various Interactive E-commerce website step by step from scratch and understanding the process of managing it. ', 'The ability to create your own website using HTML, HTML5 & XHTML from scratch!\r\nYou will learn how to align elements using modern CSS modules, like CSS Flexbox and CSS Grid.\r\nUnderstand the fundamentals of JavaScript and how it is integrated with HTML and CSS.\r\nYou will have a thorough understanding of how Object-oriented programming works in Javascript.\r\nSetup your database using SQL.\r\nBuild your backend using  MYSQL.\r\nCreate applications using Node.js.\r\nLearn the JavaScript frameworks such as React and Angular.', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(2, 'Complete Python Prime Pack', 'Become a Python expert', 2, 9, 60, 'Welcome to our Python Premium Packs. It will grant complete & targeted education on one of the most up-to-date & most influential programming languages in the world. Python language has a trouble-free syntax that makes it very attractive to beginners and ', '13', 99, 'Basic knowledge of programming concepts', 'Access to a computer that runs the Windows, Mac, or Linux operating system.', 'Internet Connection', 'This complete Python prime pack will help you to become a professional Python Developer and also help you land your first job as a Python Developer. Guide you to build various trending projects of Web Development using Django Image recognition projects. Become a data scientist with implement top industrial projects. Work with Python API boto3 and AWS for Simple service storage (S3). By the end of this prime pack, you will be Job ready for your first job as a Python developer, Data scientist, or AI/ML engineer. ', 'Overview of Python Programming Language. Concepts Based on Beginners and Advanced Level to Learn from the Scratch. Easy Tips & Tricks to Learn Python. Learning and Implementing Python through Object Orientation and Data Files. Using DataScience with Python to Build Games, Maps, and Desktop Application. Understanding Complexity and Difficulty of Data Structures', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(3, 'MySQL Technologies Pack', 'Get a Hands-On experience of MySQL', 1, 6, 50, 'Learn SQL from Basic MySQL Database Operations to Database Management Systems - MySQL, Fundamental Database Development Techniques with MySQL Server And Workbench, Oracle SQL Data Modeler, Data Modelling and Design, SQL Essentials.', '32', 27, 'Basic Computer Skills', 'Basic Mathematics skills might be beneficial', 'Understanding of Basic web terminology', 'SQL is a massive technology and it is not permitted in computer science and can be seen in  Retail, Finance, Healthcare, Science & Technology, Public Sector.\r\nAverage SQL Developer earns $88,334 per year. SQL ( Structured Query Language ) is Needed for Data Scientists to get the data and to work with that data.', 'Database Design Process, Normalization, Database Development using MySQL\r\nMaster SQL using PHP\r\nUnderstand and develop business process models( data flow diagrams) through Oracle SQL modeler. Basics of MySQL Database and Syntax\r\nEffective creation of Process models, Logical data models and Relational data models. Database Normalization with Examples - 1st, 2nd and 3rd form of Normalization. MySQL Database Administration and PhpMyAdmin Fundamentals. MySQL Security and Root Superuser and Updating Data in MySQL DB\r\nFundamentals and Overview of DBMS course\r\nDatabase Design - Beginner to Advance Level.', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(4, 'Java Prime Pack', 'Enrich your Java skills', 2, 9, 60, 'Tutorialspoint’s Java Prime Pack has been specifically designed for you. You will get a firm foundation in Java from basic to advanced level. Learn the programming fundamentals of Java such as Data Types, Functions, Classes, Inheritance, Encapsulation, Po', '25', 228, 'Passion for maths and programming logic', 'Familiar with basic computer terminology', 'Active internet connection to deploy web apps', 'Java is predicted to be the most in-demand IT skill for 2022. Java is still the most commonly used programming language for banking sectors and testing applications. Average Java Developers can earn as much as $ 85,000 per year', 'Learn the programming basics using the Java language. Get Familiar with the OOP concepts such as Inheritance, Encapsulation, Polymorphism, and Data abstraction. Learn the fundamentals of Spring and Spring Boot- Start developing your apps right now! Full Stack Java Developer - Java + JSP + Restful WS + Spring. Learn Spring & Spring Boot - Start developing your apps right now!\r\nPractice with more than 150 commonly used programs to crack your interviews.', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(5, 'JavaScript Prime Pack', 'Master JavaScript', 2, 6, 50, 'At Tutorialspoint, we ensure professional success with our JavaScript Prime Pack. We have designed this pack to broaden your understanding of JavaScript fundamentals. Gain in-depth knowledge of HTML, CSS, JavaScript, JQuery, EcmaScript, Data Structure, DO', '39', 74, 'Passion for Web Development', 'A Computer with Internet', 'Some basic Computer knowledge', 'JavaScript is one of the most legendary languages used by Web Developers. According to the latest job trends around 1.4+ Million, JavaScript Developers have been hired in the last 6 months. JavaScript developers can earn as much as $110,000 a year!', 'Basics of JavaScript. Learn JQuery, ReactJS, Web Development, Programming. Git & Github Introduction. How to use JavaScript and Manipulate elements using JavaScript. Code out important data structures in JavaScript. Object oriented programming concepts. Master JavaScript for Web Projects', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(6, 'The Full Stack Web Development', 'Learn Full Stack Web Development', 1, 6, 0, 'Gone are the days when developers used to be the expert of back-end or front-end web development. Today, developers have become multifaceted and they just don’t play a single role and are called Full-Stack web developer knowing all the sides of web develo', '33', 207, 'Basic Knowledge of Programming will help but is not necessary as this course will start from basics', 'Everything you need is covered in the bundle\r\n', 'Installed with Windows/Linux /OS', 'Full-Stack web development requires the use of 3 or more technologies so that you can design the entire application or the website from scratch. Basically, there are 5 major aspects of Full-Stack web development which a developer should know. These include Front-end, Back-end, Cache/Memory, Database and Version Control. ', 'Learn core concepts of both the front end and backend programming course. Get familiar with the latest web developer technologies and ecosystems. Learn all about sql and nosql databases. Learn complete web development process', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(7, 'Angular 8 Full Stack Development With Spring Boot', 'Step By Step Web App, Angular 8, Spring Boot 2.1.5', 1, 5, 0, 'We will create a new project in this course.\r\n\r\nAnd we will implement this project with using Spring Boot 2.1.5, Angular 8, MYSQL and Liquibase.\r\n\r\nIn our project, we will implement CRUD operations. And these CRUD operations will be requested from Angular', '5', 69, 'Basic Java Knowledge', 'Everything you need is covered in the bundle', 'Installed with Windows/Linux /OS', 'All developers curious about Angular and Spring Boot.', 'Full Stack Development With Angular And Spring Boot. Angular 8 application. Spring Boot Server Side Application.', ),
(8, 'Python For Beginners Learn Python Programming (Python 3)', 'Learn Python Programming the Easy Way', 2, 9, 0, 'If you want to learn how to write Python programs like a pro, code python like a boss, solve real-world problems, or automate repetitive and complex tasks, read on.\r\n\r\nHello. My name is Jason Cannon and I\'m the author of Python Programming for Beginners, ', '2', 60, 'Access to a computer that runs the Windows, Mac, or Linux operating system.', 'Everything you need is covered in the bundle', 'Installed with Windows/Linux /OS', 'Anyone interested in Python programming, Python scripting, or computer programming in general. Those who want to become a highly paid Python developer. Those who want to open up doors in your IT career by learning one of the world\'s most popular and in-demand programming language: Python.', 'Write Python programs that can be used on Linux, Mac, and Unix operating systems.', );
INSERT INTO `packs_details` (`id`, `packs_name`, `punch_line`, `instructor_id`, `courses`, `price`, `introduct`, `time_cpl`, `lectures`, `pre_1`, `pre_2`, `pre_3`, `whyshould`, `goals`, `image`) VALUES
(9, 'Machine Learning Interview Questions & Answers', 'Top questions (with answers) asked in Machine Learning Engineer job interviews', 1, 10, 0, 'What is Machine Learning?\r\n\r\nMachine learning is the fastest growing subfield of artificial intelligence, where systems have the ability to “learn” through data, statistics and trial and error in order to optimize processes and innovate at quicker rates. ', '3', 11, 'Enthusiasm and determination to make your mark on the world!', 'Everything you need is covered in the bundle', 'Installed with Windows/Linux /OS', 'Candidates wishing to crack ML job interviews. Machine Learning Engineers\r\nData Scientists & Data Analysts\r\nNewbies and beginners aspiring for a career in Machine Learning and Data Science. Software Engineers - Machine Learning, Deep Learning. Research Scientists - ML, advanced ML. Individuals preparing to move into Machine Learning related job roles. Machine Learning Application Developers. Artificial Intelligence Enthusiasts & Engineers. Technical Leads & Engineering Managers. Anyone interested to learn Machine Learning', 'Machine Learning interview questions with answers. Crack Machine Learning job interviews. Enhance your knowledge of Machine Learning. Become a Machine Learning Engineer. Get aware about the most trending topics on Machine Learning.', );

